import React from "react";

class List extends React.Component{
    render(){
        return(
            <div>
                <h1>Chores</h1>
                <ul>
                    {this.props.items.map((tem, index) =>
                        <li key={index}>{item}</li>)}
                </ul>
            </div>
        )
    }
}

export default List

